import React from 'react'
import Die from './components/Die'

export default function App() {

    let randomNum = []

    function allNewDice() {
        for (let i = 0; i < 10; ++i){
            let random = Math.floor(Math.random() * 7)
            randomNum.push(random)
        }
    }
    allNewDice()

    const allDice = randomNum.map(die => {
        <Die value={die} />
    })


    return (
        <main>
            <div className="container">
                {allDice}
            </div>
        </main>
    )
}
